import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { supabase, signInWithGoogle } from '../supabaseClient';
import FormInput from '../components/FormInput';
import Button from '../components/Button';
import { Link } from 'react-router-dom';
import CountryDropdown from '../components/CountryDropdown'; // Import the CountryDropdown component

const SignupPage = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [phone, setPhone] = useState('');
  const [country, setCountry] = useState(''); // State for selected country
  const [countries, setCountries] = useState([]); // State for list of countries
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchCountries = async () => {
      try {
        const response = await fetch('https://restcountries.com/v3.1/all');
        if (!response.ok) {
          throw new Error('Failed to fetch countries');
        }
        const data = await response.json();
        const formattedCountries = data.map((c) => ({
          name: c.name.common,
          code: c.cca2,
        }));
        setCountries(formattedCountries);
      } catch (err) {
        setError(err.message);
      }
    };
    fetchCountries();
  }, []);

  const handleSignUp = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);

    if (!email || !password || !firstName || !lastName || !country) {
      setError('All fields are required');
      setLoading(false);
      return;
    }

    try {
      const {
        data: { user },
        error: signUpError,
      } = await supabase.auth.signUp({
        email,
        password,
        options: {
          data: {
            first_name: firstName,
            last_name: lastName,
            phone: phone,
            country: country, // Store the selected country
          },
        },
      });

      if (signUpError) {
        setError(signUpError.message);
        setLoading(false);
        return;
      }

      // Send email verification
      const { error: verifyError } = await supabase.auth.verifyOtp({
        email,
        type: 'email',
      });

      if (verifyError) {
        setError(`Error sending verification email: ${verifyError.message}`);
        setLoading(false);
        return;
      }
      // If sign up is successful, redirect.
      navigate('/verify-email');
    } catch (err) {
      setError(err.message);
      setLoading(false);
    }
  };

  const handleSignInWithGoogle = async () => {
    setError(null);
    try {
      const { error: googleSignInError } = await signInWithGoogle();
      if (googleSignInError) {
        setError(googleSignInError.message);
      }
    } catch (err) {
      setError('Unexpected error occurred. Please try again.');
    }
  };

  return (
    <div>
      <h1>Sign Up</h1>
      <form onSubmit={handleSignUp}>
        <FormInput
          type="email"
          placeholder="Email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          required
        />
        <FormInput
          type="password"
          placeholder="Password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          required
        />
        <FormInput
          type="text"
          placeholder="First Name"
          value={firstName}
          onChange={(e) => setFirstName(e.target.value)}
          required
        />
        <FormInput
          type="text"
          placeholder="Last Name"
          value={lastName}
          onChange={(e) => setLastName(e.target.value)}
          required
        />
        <FormInput
          type="tel"
          placeholder="Phone Number (Optional)"
          value={phone}
          onChange={(e) => setPhone(e.target.value)}
        />
        <CountryDropdown
          label="Country"
          value={country}
          onChange={(e) => setCountry(e.target.value)}
          countries={countries}
        />
        <Button type="submit" disabled={loading}>
          {loading ? 'Loading...' : 'Sign Up'}
        </Button>
        <Button type="button" onClick={handleSignInWithGoogle} disabled={loading}>
          Sign Up with Google
        </Button>
        {error && <p>{error}</p>}
      </form>
      <p>
        Already have an account? <Link to="/login">Log in</Link>
      </p>
    </div>
  );
};

export default SignupPage;
